import axios from "axios";

const API_URL = `${process.env.REACT_APP_API_BASE_URL}/object-info`;
const token = JSON.parse(localStorage.getItem("token"))


const getInfoByDocketNumber = payload => {
    return axios
        .get(`${API_URL}/docket/${payload.docket_number}`, { headers:{token} })
        .then(response => {
            return response;
        })
        .catch(err => {
            return err;
        })
}


export default {
    getInfoByDocketNumber,
};
